import React, { useEffect, useState } from 'react';
import { Table, TableBody, TableCell, TableContainer, TableHead, TableRow, Paper } from '@mui/material';

export default function Result() {
  const [cars, setCars] = useState([]);

  useEffect(() => {
    fetch('http://localhost:3002/cars')
      .then(response => response.json())
      .then(data => setCars(data))
      .catch(error => console.error('Error fetching cars:', error));
  }, []);

  return (
    <div style={{ padding: '20px' }}>
      <h2 style={{ marginBottom: '16px', color: '#333' }}>Car List</h2>
      <TableContainer component={Paper} style={{ borderRadius: '10px', overflow: 'hidden' }}>
        <Table>
          <TableHead>
            <TableRow style={{ backgroundColor: '#f4f4f4' }}>
              {[
                "Make", "Model", "Year", "Description", "Odometer (km)",
                "Vehicle Condition", "Sale Location", "Sale Category",
                "Salvage Vehicle", "Sale Date", "Sale Price"
              ].map((header, index) => (
                <TableCell key={index} style={{ fontWeight: 'bold' }}>{header}</TableCell>
              ))}
            </TableRow>
          </TableHead>
          <TableBody>
            {cars.map((car, index) => (
              <TableRow 
                key={index} 
                style={{ backgroundColor: index % 2 === 0 ? '#f9f9f9' : '#ffffff' }}
                hover
              >
                <TableCell>{car.make}</TableCell>
                <TableCell>{car.model}</TableCell>
                <TableCell>{car.year}</TableCell>
                <TableCell>{car.description}</TableCell>
                <TableCell>{car.odometer}</TableCell>
                <TableCell>{car.car_condition}</TableCell>
                <TableCell>{car.states}</TableCell>
                <TableCell>{car.sales_category}</TableCell>
                <TableCell>{car.salvage_vehicle ? 'Yes' : 'No'}</TableCell>
                <TableCell>{car.sale_date}</TableCell>
                <TableCell style={{ fontWeight: 'bold', color: 'green' }}>${car.sale_price}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}
